    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN + col2 * 5 + + col0 - 62 AND ( + 31 * 70 );
  - name: tab2

outputs:
  - name: q2680.out
    data: |
      46	51	23
      64	77	40
      75	67	58
